jQuery(document).ready(function(){
  $(function() {
      // Find list items representing folders and
      // style them accordingly.  Also, turn them
      // into links that can expand/collapse the
      // tree leaf.
      $('#blog-archive-content li > div.item-list').each(function(i) {
          // Find this list's parent list item.
          var parent_li = $(this).parent('li');
  
          // Style the list item as folder.
          parent_li.addClass('folder');
  
          // Temporarily remove the list from the
          // parent list item, wrap the remaining
          // text in an anchor, then reattach it.
          var sub_ul = $(this).remove();
          parent_li.wrapInner('<a />').find('a').click(function() {
              // Make the anchor toggle the leaf display.
              sub_ul.toggle();
          });
          parent_li.append(sub_ul);
      });
  
      // Hide all lists except the outermost.
      $('#blog-archive-content ul div.item-list').hide();

      // add Google Analytics event tracking to the subscribe and donate links
      // on the navigation bar
      $('#navbar-inner .menu-item-subscribe a').click(function() {
          ga('send', 'event', 'GlobalNav', 'Subscribe|Click', window.location.href);
      });
      $('#navbar-inner .menu-item-subscribe a').click(function() {
          ga('send', 'event', 'GlobalNav', 'Donate|Click', window.location.href);
      });
  });
  
  $(".uitabs").tabs({ fxFade: true, fxSpeed: 'fast' });
});
